Get on Tysabri!

@hthsci4bb3 NEWS: Health Canada approves siponimod for treatment in adults with active secondary progressive MS

https://t.co/K1E9UMw061

#4BB3neuroimmune

@cautiouspssmst @rabcyr_alt Ocrelizumab (Ocrevus) punches my B-cells in the groin so my immune system stops gnawing my nerves. 

Diphenhydramine (benadryl) prevents an inflammatory response to the Ocrevus

Methylprednisolone (Solumedrol) tamps down my immune system so punching my B-cells doesn't kill me

So happy to be having treatment on Neuro Ambulatory Ward at Morristown Hospital today. Makes a world of difference when struggling so much with my symptoms. 

#MS #Tysabri 

@ABMhealth @mscymru @mssocietyuk

