@MustStopMS #ChatMS 
Rebif for a few years but I wasn‚Äôt compliant. Then Tysabri for about a year. Still had relapses. Got into the HALT MS study at the end of 2009.  Stem cell transplant March 2010. Nothing since transplant.
Ended up SPMS by 2016-17.  Do I bother getting on anything now??

@mstrue2toya @AnelHerreraa I disagree ;) Lemtrada is the easiest choice and one I should have been offered when it was approved. Water under the bridge tho. 

MS is a fight - to the death at present - and one I want to win and move on from as much as poss. 

What is the point In 1/2 measures?

Patient required to choose own MS med! More on a shared Lemtrada ambition. Friday at noon UK time.

@tanya_trenholm, a busy mom of 3, takes time to join https://t.co/8y9gmtuApp to talk about some of the complexities of having MS.

